import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function PessoasCrud() {
  const navigate = useNavigate();
  const API = process.env.REACT_APP_API_URL || 'http://localhost:8000/api/v2';

  const [pessoas, setPessoas] = useState([]);
  const [email, setEmail] = useState('');
  const [telefone, setTelefone] = useState('');
  const [dias, setDias] = useState([]); 
  const diasSemana = ['MONDAY','TUESDAY','WEDNESDAY','THURSDAY','FRIDAY','SATURDAY','SUNDAY'];

  useEffect(() => {
    const token = localStorage.getItem('accessToken');
    if (!token) return setPessoas([]);
    fetch(`${API}/pessoas/`, {
      headers: { 'Authorization': `Bearer ${token}` }
    })
      .then(r => r.json())
      .then(setPessoas)
      .catch(console.error);
  }, [API]);

  const toggleDia = dia => {
    setDias(prev =>
      prev.includes(dia) ? prev.filter(d => d !== dia) : [...prev, dia]
    );
  };

  const handleSubmit = e => {
    e.preventDefault();
    const token = localStorage.getItem('accessToken');
    fetch(`${API}/pessoas/`, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
        'Authorization': `Bearer ${token}`
      },
      body: JSON.stringify({ email, telefone, disponibilidades: dias })
    })
      .then(r => r.json())
      .then(nova => {
        setPessoas([...pessoas, nova]);
        setEmail(''); setTelefone(''); setDias([]);
      })
      .catch(console.error);
  };

  return (
    <div className="container mt-4">
      <button onClick={() => navigate(-1)} className="btn btn-secondary mb-3">← Voltar</button>
      <h2>Pessoas</h2>

      <form className="row g-3 mb-4" onSubmit={handleSubmit}>
        <div className="col-md-4">
          <label className="form-label">Email</label>
          <input
            type="email" className="form-control"
            value={email} onChange={e => setEmail(e.target.value)}
            required />
        </div>
        <div className="col-md-4">
          <label className="form-label">Telefone</label>
          <input
            type="tel" className="form-control"
            value={telefone} onChange={e => setTelefone(e.target.value)}
            placeholder="(00) 00000-0000" required />
        </div>
        <div className="col-md-4">
          <label className="form-label">Disponibilidade (dias)</label>
          <div className="d-flex flex-wrap">
            {diasSemana.map(d => (
              <div key={d} className="form-check me-3">
                <input
                  id={`dia-${d}`}
                  type="checkbox"
                  className="form-check-input"
                  checked={dias.includes(d)}
                  onChange={() => toggleDia(d)}
                />
                <label htmlFor={`dia-${d}`} className="form-check-label">
                  {d.slice(0,3)}
                </label>
              </div>
            ))}
          </div>
        </div>
        <div className="col-12 text-end">
          <button className="btn btn-primary">Cadastrar Pessoa</button>
        </div>
      </form>

      <ul className="list-group">
        {pessoas.map(p => (
          <li key={p.id} className="list-group-item">
            <strong>{p.id}</strong> — {p.email} — {p.telefone} —{' '}
            {p.disponibilidades?.join(', ')}
          </li>
        ))}
      </ul>
    </div>
  );
}
